import React from 'react'

export default function Board() {
  return (
    <>
    <blockquote class="twitter-tweet"><p lang="en" dir="ltr">Congratulations to the Astronauts that left Earth today. Good choice</p>&mdash; Andy Milonakis (@andymilonakis) <a href="https://twitter.com/andymilonakis/status/1266821069823975430?ref_src=twsrc%5Etfw">May 30, 2020</a></blockquote> <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
  </>
    )
}
